a9842b3a-0ae9-4de8-80f2-e5721a2daff7=Readme\r\n\=\=\=\=\=\=\=\=\=\=\=\=\=\=\r\n\r\nConfiguration\r\n-------------------------------------\r\nDo not modify this module, instead\r\n1. Create a new custom module (e.g. UnitTests)\r\n2. Download the CommunityCommons module from the App Store, when you don't already have it available in your project.\r\n3. Call 'UnitTestOverview' microflow, which calls the java action looking for available tests and opens the overview page.\r\n4. You can also choose to copy the snippet UnitTestOverview to a (new) page the new custom module\r\nMake sure the java action 'FindAllUnitTests' is called before the new page with the snippet is opened. The java action checks the model for 'unit test' microflows/ java actions. \r\n5. Take a look at the examples in the 'Example Tests' folder. Use these examples as a pointer to create your own unit tests.\r\n6. Your custom unit tests need to be prefixed with case-insensitive 'Test_' or 'UT_' in order to be picked up automatically by this unit test module.\r\n\r\n
